import React, { Component } from 'react';

const BarreDore = ({ color, width, height, position, opacity, top, right }) => (
  <div
    style={{
      backgroundColor: color,
      height: height,
      width: width,
      opacity: opacity,
      position: position,
      top: top,
      right: right
    }}
  ></div>
);

const Text = ({ position, left, top, fontSize, color }) => (
  <p
    style={{
      position: position,
      top: top,
      left: left,
      fontSize: fontSize,
      color: color
    }}
  >
    Lorem ipsum dolor sit amet, consectetur adipiscing <br /> elit, sed do
    eiusmod tempor incididunt ut labore <br /> et dolore magna aliqua. Quam
    adipiscing vitae <br /> proin sagittis nisl. Pretium lectus quam id leo in
    <br />
    vitae. Amet mattis vulputate enim nulla aliquet <br /> porttitor lacus
    luctus. Velit ut tortor pretium <br /> viverra suspendisse. Lacus vestibulum
    sed arcu <br />
    non odio euismod. Velit ut tortor pretium viverra <br />
    suspendisse. Lacus vestibulum sed arcu non odio <br />
    euismod.
  </p>
);

const Button = ({ position, top, left, bgcolor, width, height }) => (
  <button
    style={{
      position: position,
      top: top,
      left: left,
      backgroundColor: bgcolor,
      width: width,
      height: height
    }}
  >
    Contact us now
  </button>
);

const RatingG = ({ position, width, height, top, left }) => (
  <a href='https://www.google.com/search?q=sakalli+barber+shop&oq=sakalli+barber&aqs=chrome.1.69i57j69i59j69i60j69i61.3498j0j4&sourceid=chrome&ie=UTF-8#lrd=0x47c22f613d9cbf0f:0xbec95edc182a4bb9,1,,,'>
    <img
      style={{
        position: position,
        width: width,
        height: height,
        top: top,
        left: left
      }}
      src={require('../../img/google.svg')}
      alt='google rating'
    />
  </a>
);

const RatingF = ({ position, width, height, top, left }) => (
  <a href='https://www.facebook.com/pages/Barber-shop-Ballon-Cihad/228623377572625'>
    <img
      className='pl-2'
      style={{
        position: position,
        width: width,
        height: height,
        top: top,
        left: left
      }}
      src={require('../../img/facebook.svg')}
      alt='facebook rating rating'
    />
  </a>
);

export class Home extends Component {
  render() {
    return (
      <div>
        <BarreDore
          color='#5A4D10'
          height='295px'
          width='32px'
          opacity='0.2'
          position='absolute'
          top='0'
        />
        <div className='d-flex justify-content-around pt-5'>
          <div>
            <h1
              className='p-1 d-flex justify-content-center align-items-center'
              style={{
                color: 'white',
                backgroundColor: 'rgba(0,0,0,0.5)',
                fontSize: '65pt',
                width: '1020px',
                height: '93px',
                position: 'absolute',
                left: '90px',
                top: '250px'
              }}
            >
              Top Barber Shop in &nbsp;
              <span style={{ color: '#A89331' }}> Charleroi</span>
            </h1>

            <Text
              fontSize='15pt'
              color='white'
              position='absolute'
              top='400px'
              left='120px'
            />

            <Button
              bgcolor='#5A4D10'
              position='absolute'
              top='740px'
              width='350px'
              height='75px'
              left='130px'
            />
          </div>
          <div>
            <img
              style={{
                position: 'relatif',
                width: '750px',
                height: '639px'
              }}
              src={require('../../img/6.jpg')}
              alt='Homeimg'
            />

            <div class='pt-3'>
              <RatingG />
              <RatingF />
            </div>
          </div>
        </div>

        <BarreDore
          color='#5A4D10'
          height='295px'
          width='32px'
          opacity='0.2'
          position='absolute'
          top='736px'
          right='0'
        />
      </div>
    );
  }
}

export default Home;
